<script type="text/javascript">
function mapInfo(x) {
	let popup = document.getElementById(x);
	popup.classList.toggle('show');
	let clear = document.getElementById('clear-container');
	clear.setAttribute('pointer-events', 'all');
	let rect = document.querySelectorAll('rect');
	for (let a = 0; a < rect.length; a++) {
	rect[a].classList.toggle('hide');
	rect[a].setAttribute('pointer-events','none');
	};
	clear.onclick = function () {
	popup.classList.toggle('show');
	for (let a = 0; a < rect.length; a++) {
	rect[a].classList.toggle('hide');
	rect[a].setAttribute('pointer-events','all');
	};
	clear.setAttribute('pointer-events','none');
	}
}
</script>

<g pointer-events="none"><foreignObject x="589" y="300" width="40%" height="95%"><span class="st4 map-info" id="techdesk-info"><p>The Tech Desk is a service point like the Library Services Desk on the first floor, but with more specialized options.</p>
<h2>Equipment Loan</h2>
<p>The Tech Desk has a large collection of equipment and devices that students can borrow for free, ranging from the basics like laptops, headphones, chargers, and iPads to more unusual things like light therapy lamps, whiteboard markers, and sports equipment. They also offer media production equipment like digital cameras, microphones, ring lights, tripods, and more.</p>
<h2>Specialty Printing & Publishing</h2>
<p>Staff working at the Tech Desk can also help students with the large-format poster printers, or with faxing, laminating, and binding documents. They even sell some paper supplies at a low cost, like envelopes, color paper, and cardstock. </p></span></foreignObject>
</g>
<g id="techdesk" class="st1" onclick="mapInfo('techdesk-info')">
	<g id="Rectangle_2">

		</g>
	</g>
</g>
<g pointer-events="none"><foreignObject x="616" y="100" width="40%" height="95%"><span class="st4 map-info" id="portico-info"><h2>Portico Room</h2>
<p>The Portico Room is often used as an open study space, but also hosts special events from the library, such as therapy dog visits and the Black History Month Read-a-thon. Other groups on campus sometimes hold special events here, as well. Throughout the school year, the Portico Room is used as a display space for special exhibits or for showcasing student work. </p>
<h2>Portico</h2>
<p>The Portico is the outdoor balcony area connected to the Portico Room. It has a great view of the McKeldin Mall quad and the Testudo statue in front of the library. The Portico is available to students as a study space, or even as a nice spot to eat lunch.</p></span></foreignObject>
</g>
<g id="portico" class="st1" onclick="mapInfo('portico-info')">
	<g id="Rectangle_3">
		<g>
			<rect x="616" y="635" class="st2" width="145" height="136"/>
		</g>
	</g>
</g>
<g pointer-events="none"><foreignObject x="600" y="500" width="40%" height="95%"><span class="st4 map-info" id="medialabs-info"><p>The Media Labs are part of the Terrapin Learning Commons, and are available for students to reserve so they can use special software and equipment for projects.</p> 
<p>The Memory Lab offers technology for converting old media to digital formats (such as laser disc, VHS, cassette tape, DVD, and more). The Podcasting Lab is set up with four microphones controlled by a central computer, allowing students to make their own podcasts or other audio recordings in a sound-proofed space.</p></span></foreignObject>
</g> 
<g id="medialabs" class="st1" onclick="mapInfo('medialabs-info')">
	<g id="Rectangle_4">
		<g>
			<rect x="800" y="574" class="st2" width="127" height="34"/>
		</g>
	</g>
</g>
<g pointer-events="none"><foreignObject x="449" y="378" width="40%" height="95%"><span class="st4 map-info" id="tlc-info"><p>As you move to higher floors in McKeldin Library, study areas become quiet zones where people work individually and expect noise to be kept to a minimum. The Terrapin Learning Commons was designed as an alternative: a collaborative, open space where we encourage people to study together and work on group projects. </p>
<p>The Terrapin Learning Commons also offers various useful services through its Tech Desk, as well as group study rooms or specialty meeting rooms you can reserve from the website. We even hold events here, like therapy dog visits, crafting activities, and more. </p></span></foreignObject>
</g>
